// src/components/CardThree.js
import React from 'react';

function CardThree() {
  return (
    <div className="flex flex-col h-full">
      <h2 className="text-xl font-bold mb-4">Add Tasks</h2>
      <label>Task Name</label>
      <input type="text" className="mb-4 p-2 border rounded" placeholder="Enter task name" />

      <label>Assigned To</label>
      <input type="text" className="mb-4 p-2 border rounded" placeholder="Enter person name" />

      <label>Due Date</label>
      <input type="date" className="mb-4 p-2 border rounded" />

      <label>Status</label>
      <select className="p-2 border rounded">
        <option>Not Started</option>
        <option>In Progress</option>
        <option>Completed</option>
      </select>
    </div>
  );
}

export default CardThree;
